import { useState,useEffect } from "react";


const AudiobookList = () => {
    const [audiobooks, setAudiobooks] = useState([]);
    const [filter, setFilter] = useState("");
    useEffect(() => {

        const fetchedAudiobooks = [
            {
                id: 1,
                title: "The Alchemist",
                cover: "https://images-na.ssl-images-amazon.com/images/I/71aLultW5EL.jpg",
                author: "Paulo Coelho",
                rating: 4.5,
            },

            {
                id: 2,
                title: "The Little Prince",
                cover: "https://images-na.ssl-images-amazon.com/images/I/71aLultW5EL.jpg",
                author: "Antoine de Saint-Exupéry",
                rating: 4.8,
            },

            {
                id: 3,
                title: "The Catcher in the Rye",
                cover: "https://images-na.ssl-images-amazon.com/images/I/71aLultW5EL.jpg",
                rating: 4.2,
            }
        ];

        setAudiobooks(fetchedAudiobooks);
}, []);

return (
    <div className="audiobook-list">
        {
            audiobooks.map((audiobook) => (
                <div key={audiobook.id} className="audiobook-item">
                    <img src={audiobook.cover} alt={audiobook.title} className="audiobook-cover" />
                    <h2>{audiobook.title}</h2>
                </div>
            ))
        }
    </div>
);
}

export default AudiobookList;
